import React from 'react';

class LoginPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <React.Fragment>
        UsersName:
        <input />
        Psssword:
        <input />
        <br />
        <button onClick={this.props.login}>Login</button>
      </React.Fragment>
    );
  }
}

export default LoginPage;
